import React, { Component } from "react";
import Cards from "../Cards/Cards";
import "./styles.css";

class NavTabs extends Component {
  render() {
    return (
      <div className="tabs">
        <Tabs>
          <Tab label="Tab 1">
            <div className="tab-content">
              <div className="cards">
                <div className="each-card">
                  <Cards />
                </div>
                <div className="each-card">
                  <Cards />
                </div>
                {/* Add more Cards components here if needed */}
              </div>
            </div>
          </Tab>
        </Tabs>
      </div>
    );
  }
}

class Tabs extends Component {
  state = {
    activeTab: this.props.children[0].props.label,
  };
  changeTab = (tab) => {
    this.setState({ activeTab: tab });
  };
  render() {
    let content;
    let buttons = [];

    // Since we have only one tab, directly set its content
    content = this.props.children[0].props.children;

    return (
      <div>
        <TabButtons
          activeTab={this.state.activeTab}
          buttons={buttons}
          changeTab={this.changeTab}
        />
        <div className="tab-content">{content}</div>
      </div>
    );
  }
}

const TabButtons = ({ buttons, changeTab, activeTab }) => {
  return (
    <div className="navtab-main">
      <div className="tab-buttons">
        <button
          className="active" // Only one button, so it's always active
          onClick={() => changeTab(activeTab)}
        >
          <span className="tab-elements">
            <div className="roomate-icon">
              <img src="./image/roommatesicon.png" alt="" />
              <div className="tab-text">Roommates</div>
            </div>
          </span>
        </button>
        {/* No dropdown buttons since we only have one tab */}
      </div>
      <div className="navtab-hr">
        <hr />
      </div>
    </div>
  );
};

const Tab = (props) => {
  return <React.Fragment>{props.children}</React.Fragment>;
};

export default NavTabs;
